sources.styles/header/menu.scss:
.menu {
  @include flexRow;
  align-items: center;

  &__logo {
    flex: 1 1 33.3%;
  }
}

@media (max-width: $breakpoint-medium) {
  .menu {
    display: grid;
    grid-auto-flow: row;
  }
}

.menu__burger-toggle {
  display: none;
}

.menu__burger-content {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}

@media (max-width: $breakpoint-medium) {
  .menu__burger {
    position: fixed;
    top: 0;
    right: 0;
    z-index: 100;

    width: 100vw;
    height: 100vh;
    margin: 0;
    padding: 0;

    pointer-events: none;

    &-backdrop {
      position: fixed;
      z-index: 1;
      top: 0;
      right: 0;

      width: 100%;
      height: 100%;

      opacity: 0;

      transition: opacity 500ms ease-out;

      pointer-events: none;
    }

    &-icon {
      position: absolute;
      z-index: 2;
      top: 1.1rem;
      right: 1.1rem;

      width: 4rem;
      height: 4rem;
      padding: 0.6rem 0.4rem;
    }

    &-icon span,
    &-icon span::before,
    &-icon span::after {
      position: absolute;

      content: "";
      display: block;
      width: 3rem;
      height: 0.3rem;
      margin-top: 1.2rem;

      background: $c-chocolate;
      border-radius: 0.3rem;
    }

    &-icon span::before {
      margin-top: -0.8rem;
    }

    &-icon span::after {
      margin-top: 0.8rem;
    }

    &-toggle {
      position: absolute;
      z-index: 3;
      top: 1.1rem;
      right: 1.1rem;

      display: block;
      width: 4rem;
      height: 4rem;

      opacity: 0;
      outline: 1px solid black;

      cursor: pointer;
      pointer-events: all;
    }

    &-content {
      position: absolute;
      z-index: 4;
      top: 0;
      right: 0;

      display: flex;
      flex-direction: column;

      width: 13rem;
      height: 60vh;
      margin: 0;
      padding: 0 0 2rem;

      overflow: auto;

      background: $c-croissant;
      box-shadow: 0 0 1rem 0 rgba(0, 0, 0, 0.75);

      transform-origin: 0 0;
      transform: translateX(31.5rem);
      transition: transform 0.5s cubic-bezier(0.77, 0.2, 0.05, 1);

      pointer-events: all;
    }

    &-toggle:checked {
      top: 0;
      right: 0;

      width: 100%;
      height: 100%;
      margin: 0;
    }

    &-toggle:checked ~ .menu__burger-content {
      transform: none;
    }

    &-toggle:checked ~ .menu__burger-backdrop {
      opacity: 1;
    }
  }
}

@media (max-width: $breakpoint-small) {
  .menu__burger-content {
    height: 100vh;
  }
}

