    justify-content: center;
    margin-top: 50px;
    max-width: 1400px;
  }

  &__bottom {
    display: flex;
    justify-content: center;
  }

  &__logo {
    margin-left: 58px;
    width: 33.3%;
    margin-right: 300px;
  }

  &__footer-nav {
    margin-right: 300px;
  }

  &__socials {
    display: flex;
    justify-content: flex-end;
    align-items: center;
    margin-right: 59px;
    width: 33.3%;
  }

  &__copyright {
    margin-bottom: 18px;

    @extend %textCopyright;
  }
}

