  .footer {

    &__footer-nav {
      margin-right: 100px;
    }

    &__logo {
      margin-right: 100px;
    }
  }
}

@media (max-width: $breakpoint-small) {
  .footer {
    flex-direction: column;
    align-items: stretch;

    &__top {
      display: flex;
      flex-direction: column;
    }

    &__footer-nav {
      margin-right: 0;
    }

    &__logo {
      margin: 0 0 0 16px;
    }

    &__copyright {
      margin: 47px auto;
    }
  }
}

